import React, { useState } from "react";
import axios from "axios";

export default function UploadFile() {
  const [sheets, setSheets] = useState([]);
  const [fileName, setFileName] = useState("");
  const [data, setData] = useState([]);
  const [message, setMessage] = useState("");
  const [currentSheet, setCurrentSheet] = useState("");
  const [page, setPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);

  const handleUpload = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    const formData = new FormData();
    formData.append("file", file);

    try {
      const res = await axios.post("http://localhost:8000/upload", formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });

      setSheets(res.data.sheets);
      setFileName(res.data.filename);
      setMessage("File uploaded successfully!");
    } catch (err) {
      setMessage("Upload failed: " + (err.response?.data?.detail || err.message));
    }
  };

  const loadSheet = async (sheetName, pageNum = 1) => {
    try {
      const res = await axios.get("http://localhost:8000/sheet", {
        params: { filename: fileName, sheet_name: sheetName, page: pageNum }
      });

      setData(res.data.data);
      setPage(res.data.page);
      setTotalPages(res.data.total_pages);
      setCurrentSheet(sheetName);
    } catch (err) {
      setMessage("Failed to load sheet: " + (err.response?.data?.detail || err.message));
    }
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>Excel File Upload</h2>
      <input type="file" onChange={handleUpload} />
      <p>{message}</p>
      {fileName && <p><b>Uploaded File:</b> {fileName}</p>}

      {sheets.length > 0 && (
        <div>
          <h3>Select Sheet:</h3>
          <select onChange={(e) => loadSheet(e.target.value, 1)} value={currentSheet}>
            <option value="">--Select Sheet--</option>
            {sheets.map((sheet, index) => (
              <option key={index} value={sheet}>{sheet}</option>
            ))}
          </select>
        </div>
      )}

      {data.length > 0 && (
        <div>
          <h3>Sheet Data (Page {page} of {totalPages})</h3>
          <table border="1" cellPadding="5">
            <thead>
              <tr>
                {Object.keys(data[0]).map((col, idx) => (
                  <th key={idx}>{col}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {data.map((row, idx) => (
                <tr key={idx}>
                  {Object.values(row).map((val, i) => (
                    <td key={i}>{val}</td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>

          <div style={{ marginTop: "10px" }}>
            <button onClick={() => loadSheet(currentSheet, page - 1)} disabled={page <= 1}>
              Previous
            </button>
            <span style={{ margin: "0 10px" }}>Page:</span>
            <input
              type="number"
              min="1"
              max={totalPages}
              value={page}
              onChange={(e) => {
                const newPage = Number(e.target.value);
                if (newPage >= 1 && newPage <= totalPages) loadSheet(currentSheet, newPage);
              }}
              style={{ width: "50px" }}
            />
            <span> of {totalPages}</span>
            <button onClick={() => loadSheet(currentSheet, page + 1)} disabled={page >= totalPages}>
              Next
            </button>
          </div>
        </div>
      )}
    </div>
  );
}
